@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

#feed-button .button-icon
{

  /* Remove the old icon */
    list-style-image: none !important;

  /* Icon size */
    width: 40px !important;
    height: 13px !important;
  /* Icon size end */

}

/********************************
****** Normal state icon ******
********************************/
#feed-button
{
background: left no-repeat url(data:image/png;base64,) !important;
}



/********************************
******  Hover state icon *******
********************************/
#feed-button:hover
{
   background: left no-repeat url(data:image/png;base64,) !important;
}
